import React from "react";
import "./CaseStudyPage.scss";
import { withTranslation } from "react-i18next";
import { Header } from "../header/Header";
import { Footer } from "../footer/Footer";
class CaseStudyPage extends React.Component {
  render() {
    const { t } = this.props;
    return (
      <>
        <Header />
        <div className="case-study-page">
          <div className="case-study-page-wrapper">
            <div className="case-study-page-block-1">
              <div className="case-study-page-problem">
              <div className="case-study-page-problem-text">
                <div className="case-study-page-header">{t("case-study-page-header")}</div>
                <div className="case-study-page-problem-header">{t("case-study-page-problem-header")}</div>

                <div className="case-study-page-problem-item">
                {t("case-study-page-problem-item")}
                  This is Andy, Project Lead in a multinational company
                </div>
                <div className="case-study-page-problem-item">
                  Recently the KPIs of his team has fallen drastically which was
                  underpinned by the decrease in the level of engagement of the
                  members of the team
                </div>
                <div className="case-study-page-problem-item">
                  There is also a slot in his team which is being vacant for a
                  long period of time
                </div>
                <div className="case-study-page-problem-item">
                  He assumes that there is some hidden causes, but struggles to
                  detect them
                </div>
                </div>
                <div className="case-study-page-problem-img"></div>
              </div>
              <div className="case-study-page-approach"></div>
            </div>
          </div>
        </div>
        <Footer />
      </>
    );
  }
}

export default withTranslation()(CaseStudyPage);
